import React from 'react';

const Login = ({ setLoggedIn }) => {
  const handleLogin = () => {
    setLoggedIn(true);
  };

  return (
    <div>
      <h2>Login Page</h2>
      <button onClick={handleLogin}>Sign In</button>
    </div>
  );
};

export default Login;
